import React, { useContext } from "react";
import BookingCard from "../components/BookingCard";

function Bookings() {
  return (
    <>
      <div className="flex gap-2">
        {carbookings.map((Booking, idx) => {
          return <BookingCard key={idx} {...Booking} />;
        })}
      </div>
    </>
  );
}

export default Bookings;
